package qycf.samples.java.http.apache.httpClient;

import com.google.common.collect.ImmutableSet;
import com.google.gson.Gson;
import org.apache.http.*;
import org.apache.http.client.config.RequestConfig;
import org.apache.http.client.methods.HttpPost;
import org.apache.http.config.SocketConfig;
import org.apache.http.entity.ContentType;
import org.apache.http.entity.StringEntity;
import org.apache.http.impl.client.CloseableHttpClient;
import org.apache.http.impl.client.HttpClientBuilder;
import org.apache.http.impl.conn.PoolingHttpClientConnectionManager;
import org.apache.http.message.BasicHeader;
import org.apache.http.util.EntityUtils;

import java.io.IOException;

public class HttpSample {

    public static void main(String[] args) {

        RequestConfig DEFAULT_REQ_CONFIG = RequestConfig.custom()
                .setSocketTimeout(30000)
                .setConnectTimeout(30000)
                .setConnectionRequestTimeout(30000)
                .build();
        PoolingHttpClientConnectionManager manager = new PoolingHttpClientConnectionManager();
            manager.setDefaultSocketConfig(SocketConfig.custom().setTcpNoDelay(true).build());
            manager.setMaxTotal(600); // 全并发
            manager.setDefaultMaxPerRoute(200); // 单个主机/域名的并发上限

        CloseableHttpClient httpclient = HttpClientBuilder.create()
                .setDefaultRequestConfig(DEFAULT_REQ_CONFIG)
                .setDefaultHeaders(ImmutableSet.of(new BasicHeader("Connection", "close")))
                .setConnectionManager(manager)
                .build();

        String image = "";
        Gson gson = new Gson();

        HttpRequestBean httpRequestBean = new HttpRequestBean();
        httpRequestBean.setAggregationId("Archive00000020201215Aggregation");
        httpRequestBean.setImage(image);
        httpRequestBean.setMinScore(70);
        httpRequestBean.setIdentifyTopNum(5);
        String a = gson.toJson(httpRequestBean);
        HttpEntity httpEntity = new StringEntity("{\n" +
                "    \"aggregationId\": \"Archive00000020190801Aggregation\",\n" +
                "    \"identifyTopNum\": 99,\n" +
                "    \"image\": \"\",\n" +
                "    \"minScore\": 70\n" +
                "}", ContentType.APPLICATION_JSON);

        HttpPost httpPost = new HttpPost("http://10.153.109.11:8380/abf/api/v1/aggregation/cluster/identify");
        httpPost.addHeader(HttpHeaders.ACCEPT, ContentType.APPLICATION_JSON.toString());
        httpPost.addHeader("Content-Type", ContentType.APPLICATION_JSON.toString());
//        httpPost.addHeader(HttpHeaders.CONTENT_LENGTH, String.valueOf(httpEntity.getContentLength()));
//        httpPost.addHeader(HttpHeaders.CONTENT_LENGTH, );

        httpPost.setEntity(httpEntity);

        try {
            Header[] headers = httpPost.getAllHeaders();
            HttpResponse httpResponse = httpclient.execute(httpPost);
            System.out.println(EntityUtils.toString(httpResponse.getEntity()));
        } catch (IOException e) {
            e.printStackTrace();
        }
    }
}
